
<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0" />
  <title>Russian Roulette - Offline</title>
  <style>
    body {
      margin: 0;
      padding: 0;
      background-color: #111;
      color: #fff;
      font-family: Arial, sans-serif;
      height: 100vh;
      display: flex;
      justify-content: center;
      align-items: center;
      position: relative;
    }

    #gun {
      width: 400px;
      cursor: pointer;
      position: absolute;
      top: 50%;
      left: 50%;
      transform: translate(-50%, -50%);
    }

    #bullet {
      width: 60px;
      cursor: pointer;
      position: absolute;
      bottom: 30px;
      right: 30px;
    }

    #ammo-count {
      position: absolute;
      bottom: 35px;
      right: 100px;
      font-size: 24px;
    }

    #survival-rate {
      position: absolute;
      top: 20px;
      right: 30px;
      font-size: 24px;
    }

    #muzzle-flash {
      display: none;
      position: absolute;
      top: 35%;
      left: 50%;
      transform: translate(-50%, -50%);
      width: 100px;
      height: 100px;
      background: radial-gradient(circle, #f00, transparent);
      border-radius: 50%;
    }

    #death-screen, #survive-screen {
      display: none;
      position: absolute;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      background-color: rgba(0, 0, 0, 0.9);
      font-size: 60px;
      justify-content: center;
      align-items: center;
      flex-direction: column;
      z-index: 10;
    }

    #death-screen {
      color: red;
    }

    #survive-screen {
      color: #0f0;
    }

    .confirm-btn {
      margin-top: 30px;
      font-size: 20px;
      padding: 10px 20px;
      background-color: #222;
      color: white;
      border: 1px solid #555;
      cursor: pointer;
    }

    .status-info {
      font-size: 24px;
      margin-bottom: 20px;
    }
  </style>
</head>

  <script>
    let bulletCount = 0;
    const maxBullets = 6;
    const ammoCount = document.getElementById("ammo-count");
    const survivalRate = document.getElementById("survival-rate");
    const muzzleFlash = document.getElementById("muzzle-flash");
    const deathScreen = document.getElementById("death-screen");
    const surviveScreen = document.getElementById("survive-screen");
    const gun = document.getElementById("gun");
    const bullet = document.getElementById("bullet");
    const fireSound = document.getElementById("fire-sound");
    const loadSound = document.getElementById("load-sound");
    const explosionSound = document.getElementById("explosion-sound");
    const deathInfo = document.getElementById("death-info");
    const surviveInfo = document.getElementById("survive-info");

    bullet.addEventListener("click", () => {
      if (bulletCount < maxBullets) {
        bulletCount++;
        loadSound.currentTime = 0;
        loadSound.play();
        updateUI();
      }
    });

    gun.addEventListener("click", () => {
      const survival = bulletCount === 6 ? 0.05 : (1 - bulletCount / 6);
      const result = Math.random();

      if (result > survival) {
        explosionSound.currentTime = 0;
        explosionSound.play();
        showDeath(survival);
      } else {
        fireSound.currentTime = 0;
        fireSound.play();
        showSurvival(survival);
      }
    });

    function updateUI() {
      ammoCount.textContent = `${bulletCount}/6`;
      let survival = bulletCount === 6 ? 0.05 : (1 - bulletCount / 6);
      survivalRate.textContent = `Survival: ${(survival * 100).toFixed(0)}%`;
    }

    function showDeath(survival) {
      muzzleFlash.style.display = "block";
      deathInfo.textContent = `Ammo: ${bulletCount}/6 | Survival Rate: ${(survival * 100).toFixed(0)}%`;
      setTimeout(() => {
        muzzleFlash.style.display = "none";
        deathScreen.style.display = "flex";
      }, 300);
    }

    function showSurvival(survival) {
      surviveInfo.textContent = `Ammo: ${bulletCount}/6 | Survival Rate: ${(survival * 100).toFixed(0)}%`;
      surviveScreen.style.display = "flex";
    }

    function resetFromOverlay() {
      deathScreen.style.display = "none";
      surviveScreen.style.display = "none";
      resetGame();
    }

    function resetGame() {
      bulletCount = 0;
      updateUI();
    }

    updateUI();
  </script>
</body>
